    YoYoService yoyoService = new YoYoService();

    double strockDashOffSet = 565.2;


    double nextShuttle = 0.0f;
    
    public async Task StartTimer()
    {

        await yoyoService.OnTestStart();

        nextShuttle = yoyoService.ShuttleTimeLeft;
        while (nextShuttle < 1)
        {
            await Task.Delay(1000);
            nextShuttle = yoyoService.ShuttleTimeLeft;
            HandleProgress(yoyoService.ShuttleTimeElapsed);
            StateHasChanged();
        }
              
       
    }


    public void HandleProgress(double val)
    {
        var r = 90;
        var c = Math.PI * (r * 2);

        if (val < 0)
        {
            val = 0;
        }
        if (val > 100)
        {
            val = 100;
        }

        var pct = ((100 - val) / 100) * c;
        strockDashOffSet = pct;
    }

